  false,\n\t\"url\": null,\n\t\"notes\": \"The bathymetric contours, which comprise
  this GIS data layer, contains contours for the U.S. Atlantic East Coast. The dataset
  was created for use with the USGS Continental Margin Mapping Program (CONMAP) by
  digitizing available paper maps. In 1984 the USGS began a systematic program of
  reconnaissance-scale imaging of the poorly explored deepwater parts of the EEZ,
  using a long-range sidescan-sonar system known as GLORIA (Geologic LOng Range Inclined
  Asdic). The instrument was designed, built, and operated by the United Kingdom's
  Institute of Oceanographic Sciences (IOS). Imaging of the U.S. Atlantic East Coast
  was completed in 1987. These sidescan data were subsequently processed, digitally
  mosaicked and published in atlas form in 1991. The bathymetric contours, which comprise
  this GIS data layer, were used in the interpretation of the US Atlantic Coast GLORIA
  data. The contours were also used in the atlas and were printed directly onto each
  GLORIA imagery sheet. Please see the Larger_Work citation.\",\n\t\"license_title\":
